import QuoteList from "../components/quotes/QuoteList";

const DUMMY_QUOTES = [
    {
        id:'q1',
        author:'someone',
        text:'something is fun'
    },
    {
        id:'q2',
        author:'someone1',
        text:'something 1  is fun'
    },
    {
        id:'q3',
        author:'someone2',
        text:'something 2 is fun'
    },
]

const AllQuotes = ()=>{
    return(
       <QuoteList quotes={DUMMY_QUOTES}/>
    );
};

export default AllQuotes;
